        } else if (valueRarity > 30 && valueRarity <= 50) {
            if (rand <= 40) myTruffle.level++;
        } else if (valueRarity > 50 && valueRarity <= 70) {
            if (rand <= 45) myTruffle.level++;
        } else if (valueRarity > 70 && valueRarity <= 90) {
